-- Name: validate_queue_status(text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.validate_queue_status(input_status text) RETURNS text
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Return the input if it's valid (including new processing status)
    IF input_status IN ('waiting', 'serving', 'completed', 'cancelled', 'processing') THEN
        RETURN input_status;
    END IF;
    
    -- Log unknown status
    RAISE WARNING 'Unknown queue status "%" encountered, falling back to "waiting"', input_status;
    
    -- Return fallback
    RETURN 'waiting';
END;
$$;


