--
-- TOC entry 267 (class 1259 OID 47144)
-- Name: queue_processing_sla_metrics; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.queue_processing_sla_metrics AS
 SELECT qe.customer_id,
    c.name AS customer_name,
    c.or_number,
    qe.processing_start_at,
    qe.processing_end_at,
        CASE
            WHEN ((qe.processing_start_at IS NOT NULL) AND (qe.processing_end_at IS NOT NULL)) THEN (EXTRACT(epoch FROM (qe.processing_end_at - qe.processing_start_at)) / 60.0)
            ELSE NULL::numeric
        END AS processing_time_minutes,
    qe.event_type,
    qe.created_at AS event_created_at,
    c.queue_status AS current_status
   FROM (public.queue_events qe
     JOIN public.customers c ON ((qe.customer_id = c.id)))
  WHERE (qe.processing_start_at IS NOT NULL)
  ORDER BY qe.processing_start_at DESC;


ALTER VIEW public.queue_processing_sla_metrics OWNER TO postgres;

