    CONSTRAINT transactions_payment_mode_check CHECK (((payment_mode)::text = ANY ((ARRAY['gcash'::character varying, 'maya'::character varying, 'bank_transfer'::character varying, 'credit_card'::character varying, 'cash'::character varying])::text[]))),
